INSERT INTO `aboutus` (`paragraph1`, `paragraph2`, `paragraph3`, `id`) VALUES
('    <br/>\r\n                                  Cinegold is a leading world class cinema that scours the world in search of global gems to provide its guests with enhanced movie going experience. When Bahria Town was first  founded in late 1990, Its pioneers thought of providing its residents with intimate, comfortable and a friendly atmosphere. Its first aim was to make its residents to get out and enjoy their evenings by bringing a movie screen near to them.\r\n\r\n<br/>\r\n<br/>\r\n\r\nFounded in 2014, we have demonstrated our drive to push the cinema experience to new and exciting levels through our luxury cinema and theatre concepts. Since 2014, our business has been the best in providing an elevated level of the movie going experience.\r\n\r\n<br/>\r\n<br/>\r\n\r\n\r\nWith luxury lounges offering fully reclining, over-sized leather seats with in cinema, elegant lobby spaces, cutting edge sound and projection technology and with our world class Gold Restaurant offering a complete gourmet and delicious menu, we have succeeded in attracting people not only from within the community but from outside the community too. We have strived to change the way movie goers will watch the movies forever.\r\n\r\n<br/>\r\n<br/>\r\n\r\nWe are a family owned by the families we serve! \r\n\r\n\r\n<br/>\r\n<br/>', 'CAREERS AT CINEGOLD PLEX CINEMAS \nWHO ARE WE? \nWe are in the business of Creating Great Moments for Everyone. Every day. This includes our employees. We believe that it is the quality a. personal d.ication of our staff that is foundation of our success. We are strongly influenced and guided by our values which include: We are loold: We are passionate and We are together. Curreritly we have.. locations in the UAE. v. in Oman and in Beirut a. Egypt. with 263 screens. Through the efforts of our skilled operations and corporate teams. we are taking our cinemas and customer service to new countries including Kenya. Pakistan. Kuwait. and Qatar. The list keeps growing every day! Cinegold Plex Cinemas is .olly own. by Majid Al Futtaim Group. Majid Al Futtaim. the Founder and President of the Majid Al Futtaim Group (establish. in 1992) had a pioneering vision which has chang. the face of shopping. entertainment and leisure in the Midd. East a. North Afri.. \nCONTACT US CAREERS FAQ \nAs part of Majid Futtaim Ventures. our business aims to provide the highest Levels of quality and entertainment We are constantly developing our business a. pushing the boundaries so that we guarantee the best cinema experience to our customers. We are proud to be the biggest cinema exhibitor in the MENA region. with the IM. with Laser screen in the Mall of the Emirates. Dubai and the exclusive 4DX technology In September 2o1.5. we were proud to launch a world first. the TheEATre by Rhodes concept \nHOW WE WORK \n.ing to the cinema is one of the Midd, East\'s favorite forms of ente,ainment. Cinemas are busiest during the weeke.s and evenings. \nOur staff typically work 48 hours a week over six days. with a mixture of day a. night shifts including weeke.s. Our teams are made up of multi-skill. individua. who may be selling tickets in our ticket box one day and then serving our customers their coke a. popcom at the candy bar the next. \nOur Dubai Head Office is hc,me to a range of corporate functions from Operations. Marketing. HR. IT. Finance. Business Development and Project Management. Our operating hours are from 8.3oam to 6pm Su.ay to Thursday \n', NULL, 1);
