(289, 'Punjab Nahi Jaungi', 'Mehtab Khagga and his family have had generation old ties of love and friendship with Bebojee and her<br>family despite them belonging to 2 different worlds. Fawad Khagga, grandson of Mehtab ...\r\n<br>\r\nComedy, Romance\r\n<br> \r\nDirector: Nadeem Beyg\r\n<br>\r\nStars: Humayun Saeed, Iman Ali, Samina Peerzada\r\n<br><br>', '2d', '8.5', '/cinestarimages/Punjab_banner.jpg', '/cinestarimages/Punjab_poster.jpg', b'1', '2017-09-17 00:35:45', '11', 'https://www.youtube.com/embed/z1AaNERuYHs'),
(290, 'Na Maloom Afraad 2', 'This is a sequel to 2014 comedy \"Na Maloom Afrad\" (\"Unknown men\") with same lead cast and characters.<br>Three unfortunate souls plan a big heist on their shortcut to wealth but things go comically wrong along<br>the way. \r\n<br>\r\nComedy, Crime, Thriller\r\n<br>\r\nDirector: Nabeel Qureshi\r\n<br>\r\nStars: Hania Aamir, Ashiq Ahmed, Nayyar Ejaz\r\n<br>', '2d', '7.5', '/cinestarimages/Na-Maloom-Afraad2_banner.jpg', '/cinestarimages/Na-Maloom-Afraad2_poster.jpg', b'1', '2017-09-17 00:39:38', '10', 'https://www.youtube.com/embed/g1WxHwetlhc'),
(291, 'Baadshaho', 'An Indian queen asks her bodyguard to steal back gold taken from her by the Indian government during<br>The Emergency period in 1975.\r\n<br>\r\nDirector: Milan Luthria\r\n<br> \r\nStars: Ajay Devgn, Ileana D\'Cruz, Emraan Hashmi\r\n<br>', '2d', '5.9', '/cinestarimages/Baadshaho-banner.jpg', '/cinestarimages/Baadshaho-poster.jpg', b'1', '2017-09-17 00:41:53', '9', 'https://www.youtube.com/embed/Ny7fULat8ws'),
(292, 'IT', 'A group of bullied kids band together when a shapeshifting demon, taking the appearance of clown, begins<br>hunting children.\r\n<br>\r\nDirector: Andy Muschietti\r\n<br>\r\nStars: Bill Skarsg√•rd, Jaeden Lieberher, Finn Wolfhard\r\n<br>', '2d', '8.1', '/cinestarimages/IT-banner.jpg', '/cinestarimages/IT-poster.jpg', b'1', '2017-09-17 00:43:02', '8', 'https://www.youtube.com/embed/7no56Zw1e20'),
(293, 'Lucknow Central', 'Set in a jail in Lucknow, a group of prisoners form a music band.\r\n<br>\r\nDirector: Ranjit Tiwari\r\n<br> \r\nStars: Farhan Akhtar, Diana Penty, Ronit Roy\r\n<br>', '2d', '6.5', '/cinestarimages/Lucknow-Central-banner.jpg', '/cinestarimages/Lucknow-Central-poster.jpg', b'1', '2017-09-17 00:44:32', '7', 'https://www.youtube.com/embed/KAQvmBSzHlI'),
(295, 'Poster Boys', 'Life of three men comes in trouble when their photos appear on advertisement for sterilization.\r\n<br>\r\nDirector: Shreyas Talpade\r\n<br> \r\nStars: Sunny Deol, Bobby Deol, Shreyas Talpade\r\n<br>', '2d', '6.5', '/cinestarimages/Poster-Boys-banner.jpg', '/cinestarimages/Poster-Boys-poster.jpg', b'1', '2017-09-17 00:47:31', '6', 'https://www.youtube.com/embed/ct2feF4oz54'),
(296, 'Simran', 'A Gujarati housekeeping lady in the US allows ambition to get the better of her & gets involved in a world of <br>crime. Simran is a racy, fun film with Kangana Ranaut playing the titular role.\r\n<br>\r\nDirector: Hansal Mehta\r\n<br> \r\nStars: Kangana Ranaut, Catherine Dyer, Evette Young\r\n<br>', '2d', '6.5', '/cinestarimages/Simran-banner.jpg', '/cinestarimages/Simran-poster.jpg', b'1', '2017-09-17 00:48:57', '5', 'https://www.youtube.com/embed/YBrjw0dj8Kg'),
(298, 'Saawan', 'A handicapped 9-year old boy who lives in a valley in the mountains of Balochistan is rejected by his father,\r\n<br>intimidated by society, harassed by friends and left alone due to his ...\r\n<br>\r\nDirector: Farhan Alam\r\n<br>\r\nStars: Saleem Mairaj, Syed Karam Hussain, Arif Bahalim\r\n<br>', '2d', '9.1', '/cinestarimages/Saawan_banner.jpg', '/cinestarimages/Saawan_poster.jpg', b'1', '2017-09-17 00:54:03', '4', 'https://www.youtube.com/embed/cNjTwMRYOnM'),
