(6, 'Hamburger', 'A hamburger or burger is a sandwich consisting of one or more cooked patties of ground meat, usually beef, placed inside a sliced bread roll or bun. The patty may be pan fried, barbecued, or flame broiled. ', '/cinestarimages/Dine-in02-banner.jpg', 1),
(7, 'Doughnut', 'A doughnut or donut is a type of fried dough confectionery or dessert food. The doughnut is popular in many countries and prepared in various forms as a sweet snack that can be homemade or purchased in ...', '/cinestarimages/Dine-in03-banner.jpg', 1);
